describe('TableTreeComponent Component', () => {
    let fixture: ComponentFixture<TableTreeComponent>,
        comp: TableTreeComponent,
        debugElement: DebugElement,
        element: HTMLElement;
        
    beforeEach(async(() => {
        TestBed.resetTestEnvironment();
        TestBed.initTestEnvironment(
            BrowserDynamicTestingModule,
            platformBrowserDynamicTesting()
        );
        TestBed.configureTestingModule({
            imports: [FormsModule, HttpModule, ReactiveFormsModule,
                DataTableModule, DialogModule, BrowserAnimationsModule,
                NoopAnimationsModule, ConfirmDialogModule, GrowlModule,
                DropdownModule, CheckboxModule,
                TreeModule, AutoCompleteModule],
            declarations: [TableTreeComponent, LoadingComponent],
            providers: [XmlService,
                MockBackend,
                {
                    provide: XmlService, useValue: {
                        getTreeFromDefaultXml(defaultXml:string) {
                            return Observable.of(mockdata);
                        }                     
                    }
                },

                BaseRequestOptions,
                {
                    provide: Http,
                    useFactory: (backend: ConnectionBackend, options: BaseRequestOptions) => new Http(backend, options),
                    deps: [MockBackend, BaseRequestOptions]
                },
                TableTreeComponent
            ]
        });
      
    }));

   
    beforeEach(() => {
        fixture = TestBed.createComponent(TableTreeComponent);
        comp = fixture.componentInstance;
        debugElement = fixture.debugElement;
        element = debugElement.nativeElement;         
    });

    it('should create the app', async(() => {
        let app = fixture.debugElement.componentInstance;
        expect(app).toBeTruthy();
    }));

    it('should load filter value input', (() => {      
        fixture.detectChanges();
        const filterValue = debugElement.query(By.css('#inputFilterValue')).nativeElement;
        expect(filterValue.value).toBe('');
    }));

    it('should load filter key autocomplete', (() => {
        fixture.detectChanges();
        const filterKey = debugElement.query(By.css('#inputFilterKey')).nativeElement;
        expect(filterKey).toBeTruthy();
    }));
     
    it('should call service', async(inject([Http], (http) => {
        let service = TestBed.get(XmlService);
        let mockBackend = TestBed.get(MockBackend);

        mockBackend.connections.subscribe((c: any) => {
            c.mockRespond(new Response(new ResponseOptions({
                body: mockdata          
            })));
        });

        http.get(gAppConfigSettings + 'xml/gettreenode').subscribe(res => {
            expect(JSON.stringify(res.json())).toEqual(JSON.stringify(mockdata));
        });
    })));

   
    it('should call ngOnInit', () => {
        comp.selectedTable = petroTables[1];
        comp.treenode = mockdata.data;
        comp.filterNodes = mockdata.data;
        spyOn(comp, 'ngOnInit').and.callThrough();
        fixture.detectChanges();
        expect(comp.ngOnInit).toHaveBeenCalled();
        
    })  

    it('should load tree', () => {
        comp.treenode = mockdata.data;
        comp.filterNodes = mockdata.data;     
        fixture.detectChanges();      
        const tree = fixture.nativeElement.querySelector('p-tree').innerText;        
        expect(tree.indexOf('CAPKTable') >= 0).toBe(true);
    });
});




